package Serialization;

public class location {
	
	private double lat;
	private double lng;
	
	public double getLat() {
		return lat;
	}
	public void setLat(double lat) {
		this.lat = lat;
	}
	
	
	
	
	
	public void setLng(double lng) {
		// TODO Auto-generated method stub
		this.lng = lng;
	}
	public double getLng() {
		return lng;
	}
	
	
	
	

}
